import React from "react";
import classes from "./MealItemForm.module.css";

const MealForm = () => {
  return (
    <form className={classes.form}>
      <input type="number" label="Amount" defaultValue="1" min="1" max="5" />
      <button>+ Add</button>
    </form>
  );
};

export default MealForm;
